●車内で端末機器の音声をカーステレオから安定した音質で聴くことができる、AUXケーブル。<br>
●車内配線がしやすい2.0mコード仕様。<br>
●コードを巻取り、長さが調節できるコードキーパー付属。<br><br>

*カーオーディオにAUX端子口（φ3.5ステレオ）が無い車では、本製品を使用できません。<br><br>
【仕様】<br>
